import './Header.css'
import {link} from 'react-router-dom';
class Header extends Component {
    render() {
        return (
            <div>
              <div className="topnav">
              <div className="link" > <a href="/">LOGO</a></div>
                <div className="link" > <a href="#home">Home</a></div>
                <div className="link" ><a href="#news">Login</a></div>
                <div className="link" ><a href="#contact">Signup</a></div>
                <div className="link" ><a href="#contact">About</a></div>
                <div className="Search-Bar">
                   <input className="search-content" type ="text" placeholder="Search book" name="search bar"></input>
                   <button className="search-submit-button" type="submit" value="Submit" >Search</button>
                </div>

                </div>
            </div>    
        )
    }
}

export default Header;
